import Product from "./Product"

export default function ProductsContainer() {
    return (
        <div>
            <Product name="Wealth" />
            <Product name="Cash" />
            <Product name="Venture" />
            <Product name="Private Equity" />
            <Product name="Real State" />
        </div>
    )
}
